import React from 'react';
import {Router, Switch} from 'react-router-dom'

import Navbar from './Navbar'
import PokeDex from './PokeDex';

function App() {
  return (
    <Switch>
      <Navbar /> 
      <PokeDex />
    </Switch>
  )
}

export default App;
